TalComponent::~TalComponent()
{
    getProcessor()->removeChangeListener(this);
    deleteAllChildren();
}

FilmStripKnob* TalComponent::addNormalKnob(Component *component, int x, int y, TalCore* const ownerFilter, const Image knobImage, int numOfFrames, int parameter)
{
	FilmStripKnob *filmStripKnob;
	component->addAndMakeVisible(filmStripKnob = new FilmStripKnob(knobImage,
									 numOfFrames,
									 false,
                                     parameter));
    filmStripKnob->setBounds(x, y, knobImage.getWidth(), knobImage.getHeight() / numOfFrames);
	filmStripKnob->addListener(this);
	return filmStripKnob;
}

ImageToggleButton* TalComponent::addNormalButton(Component *component, int x, int y, TalCore* const ownerFilter, const Image buttonImage, bool isKickButton, int parameter)
{
	ImageToggleButton *imageToggleButton;
	component->addAndMakeVisible(imageToggleButton = new ImageToggleButton("Toggle Button", buttonImage, false, isKickButton, parameter));
    imageToggleButton->setBounds(x, y, buttonImage.getWidth(), buttonImage.getHeight() / 2);
	imageToggleButton->addListener(this);
	return imageToggleButton;
}

ImageSlider* TalComponent::addSlider(Component *component, int x, int y, TalCore* const ownerFilter, const Image sliderImage, int height, int parameter)
{
	ImageSlider *imageSlider;
	component->addAndMakeVisible(imageSlider = new ImageSlider(sliderImage, height, parameter));
	imageSlider->setBounds(x, y, sliderImage.getWidth(), height + sliderImage.getHeight());
	imageSlider->addListener(this);
	return imageSlider;
}

//==============================================================================
void TalComponent::paint (Graphics& g)
{
    // just clear the window
    g.fillAll (Colour::greyLevel (0.9f));

    Image backgroundImage = ImageCache::getFromMemory(bmp00128_png, bmp00128_pngSize);
    g.drawImage (backgroundImage,
                 0, 0, backgroundImage.getWidth(), backgroundImage.getHeight(),
                 0, 0, backgroundImage.getWidth(), backgroundImage.getHeight());
}

void TalComponent::sliderDragStarted (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->beginParameterChangeGesture(values["index"]);
    }
}

void TalComponent::sliderDragEnded (Slider* slider)
{
    NamedValueSet values = slider->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->endParameterChangeGesture(values["index"]);
    }
}

void TalComponent::sliderValueChanged (Slider* caller)
{
    TalCore* const filter = getProcessor();

    NamedValueSet values = caller->getProperties();
    if (values.contains(Identifier("index")))
    {
        filter->setParameterNotifyingHost(values["index"], (float)caller->getValue());
    }
}

void TalComponent::changeListenerCallback(ChangeBroadcaster* processor)
{
    // this is the filter telling us that it's changed, so we'll update our
    // display of the time, midi message, etc.
    updateParametersFromFilter();
}

void TalComponent::buttonClicked (Button* caller)
{
    NamedValueSet values = caller->getProperties();
    if (values.contains(Identifier("index")))
    {
        TalCore* const filter = getProcessor();
        filter->setParameterNotifyingHost(values["index"], (float)caller->getToggleState());
    }
}

//==============================================================================
void TalComponent::updateParametersFromFilter()
{
    TalCore* const filter = getProcessor();

    // we use this lock to make sure the processBlock() method isn't writing to the
    // lastMidiMessage variable while we're trying to read it, but be extra-careful to
    // only hold the lock for a minimum amount of time..
    filter->getCallbackLock().enter();

    // take a local copy of the info we need while we've got the lock..
	float volume = filter->getParameter(TAL_VOLUME);
    float harmonics = filter->getParameter(HARMONICS);
	float oscTranspose = filter->getParameter(OSCTRANSPOSE);
	float portamento = filter->getParameter(PORTAMENTO);
	float tune = filter->getParameter(TAL_TUNE);
    float envelopeRelease = filter->getParameter(ENVELOPERELEASE);

    float noiseVolume = filter->getParameter(NOISEVOLUME);
    float pulseVolume = filter->getParameter(PULSEVOLUME);
    float sawVolume = filter->getParameter(SAWVOLUME);
    float subOscVolume = filter->getParameter(SUBOSCVOLUME);

    float esserIntensity = filter->getParameter(ESSERINTENSITY);
    float pulseTune = filter->getParameter(PULSETUNE);
    float sawTune = filter->getParameter(SAWTUNE);
    float pulseFineTune = filter->getParameter(PULSEFINETUNE);
    float sawFineTune = filter->getParameter(SAWFINETUNE);

    float band00 = filter->getParameter(VOCODERBAND00);
    float band01 = filter->getParameter(VOCODERBAND01);
    float band02 = filter->getParameter(VOCODERBAND02);
    float band03 = filter->getParameter(VOCODERBAND03);
    float band04 = filter->getParameter(VOCODERBAND04);
    float band05 = filter->getParameter(VOCODERBAND05);
    float band06 = filter->getParameter(VOCODERBAND06);
    float band07 = filter->getParameter(VOCODERBAND07);
    float band08 = filter->getParameter(VOCODERBAND08);
    float band09 = filter->getParameter(VOCODERBAND09);
    float band10 = filter->getParameter(VOCODERBAND10);

    float panic = filter->getParameter(PANIC);
    float inputMode = filter->getParameter(INPUTMODE);
    float chorus = filter->getParameter(CHORUS);
    float polyMode = filter->getParameter(POLYMODE);
    float oscSync = filter->getParameter(OSCSYNC);

    // ..release the lock ASAP
    filter->getCallbackLock().exit();

	this->volumeKnob->setValue(volume, dontSendNotification);
	this->harmonicsKnob->setValue(harmonics, dontSendNotification);
	this->oscTransposeKnob->setValue(oscTranspose, dontSendNotification);
	this->portamentoKnob->setValue(portamento, dontSendNotification);
	this->tuneKnob->setValue(tune, dontSendNotification);
	this->envelopeReleaseKnob->setValue(envelopeRelease, dontSendNotification);

	this->noiseVolumeSlider->setValue(noiseVolume, dontSendNotification);
	this->pulseVolumeSlider->setValue(pulseVolume, dontSendNotification);
	this->sawVolumeSlider->setValue(sawVolume, dontSendNotification);
	this->subOscVolumeSlider->setValue(subOscVolume, dontSendNotification);

    this->esserIntensityKnob->setValue(esserIntensity, dontSendNotification);
	this->pulseTuneKnob->setValue(pulseTune, dontSendNotification);
	this->sawTuneKnob->setValue(sawTune, dontSendNotification);
	this->pulseFineTuneKnob->setValue(pulseFineTune, dontSendNotification);
	this->sawFineTuneKnob->setValue(sawFineTune, dontSendNotification);

    this->band00Slider->setValue(band00, dontSendNotification);
    this->band01Slider->setValue(band01, dontSendNotification);
    this->band02Slider->setValue(band02, dontSendNotification);
    this->band03Slider->setValue(band03, dontSendNotification);
    this->band04Slider->setValue(band04, dontSendNotification);
    this->band05Slider->setValue(band05, dontSendNotification);
    this->band06Slider->setValue(band06, dontSendNotification);
    this->band07Slider->setValue(band07, dontSendNotification);
    this->band08Slider->setValue(band08, dontSendNotification);
    this->band09Slider->setValue(band09, dontSendNotification);
    this->band10Slider->setValue(band10, dontSendNotification);

    this->inputModeButton->setToggleState(inputMode > 0.0f, dontSendNotification);
    this->chorusButton->setToggleState(chorus > 0.0f, dontSendNotification);
    this->polyModeButton->setToggleState(polyMode > 0.0f, dontSendNotification);
    this->oscSyncButton->setToggleState(oscSync > 0.0f, dontSendNotification);

    if (panic == 0.0f)
    this->panicButton->setToggleState(false, dontSendNotification);
}

